import React, { Component } from 'react';
import ChipsHTML from '../Chips/ChipsHTML';
import ChipsSASS from '../Chips/ChipsSASS';
import ChipsBootstrap from '../Chips/ChipsBootstrap';
import ChipsJavascript from '../Chips/ChipsJavascript';
import ChipsAPI from '../Chips/ChipsAPI';

const Style = {
    github: {
        color: 'rgb(241, 240, 179)',
        marginRight: 25
    },
    internet: {
        color: 'rgb(109, 195, 221)',
        marginLeft: 25
    }
};

export default class FourthWork extends Component {
    render() {
        return (
            <div className="caseFour">
                <div className="icons">
                    <ChipsHTML />
                    <ChipsSASS />
                    <ChipsBootstrap />
                    <ChipsJavascript />
                    <ChipsAPI />
                </div>
                <div className="socials">
                    {/* eslint-disable-next-line */}
                    <a><i class="fab fa-github fa-5x" href="" rel="noopener" style={Style.github}></i></a>
                    {/* eslint-disable-next-line */}
                    <a><i class="fas fa-globe fa-5x" href="https://chrisdemey.github.io/Hitman2-website/" rel="noopener" style={Style.internet}></i></a>
                </div>
            </div>
        );
    }
}
